 The houses are mostly stone because   
 there was not any bricks made locally 
 and stone was quarried nearby.Out of  
 217 houses less than 20 are less than 
 5 years old.None of the terraces (11) 
 have more than 15 houses.Many were    
 built when the village was a very busy
 railway junction earlier this century.

